"    <div id=\"topicTitle\">",
"     Patient information: Vagal maneuvers and their responses (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/vagal-maneuvers-and-their-responses-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H2366600485\">",
"      <span class=\"h1\">",
"       What are vagal maneuvers?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Vagal maneuvers are ways doctors can affect a person&rsquo;s heartbeat without using medicines. For some vagal maneuvers, the doctor will press on a certain part of your body. For others, he or she will have you make a certain movement with your body.",
"     </p>",
"     <p>",
"      Vagal maneuvers cause changes in your nervous system. Your nervous system then sends signals to your heart. These signals cause a &ldquo;response&rdquo; that affects your heartbeat.",
"     </p>",
"     <p>",
"      Normally, a heartbeat happens when an electrical signal starts in a certain area in the heart. This electrical signal follows a set path to spread across the heart. As it spreads, the signal causes the heart muscle to squeeze in a normal way and at a regular rate. This causes the heartbeat.",
"     </p>",
"     <p>",
"      Vagal maneuvers slow down the electrical signals that start a heartbeat. They can also slow down the electrical signals that spread across the heart. Both of these things can slow down the heartbeat.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2366600500\">",
"      <span class=\"h1\">",
"       What are examples of vagal maneuvers?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are many different vagal maneuvers. The 2 that doctors use most often are &ldquo;carotid sinus massage&rdquo; and the &ldquo;Valsalva maneuver.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2366600515\">",
"      <span class=\"h1\">",
"       What does carotid sinus massage involve?",
"      </span>",
"      &nbsp;&mdash;&nbsp;To do carotid sinus massage, the doctor will have you lie down. Then he or she will press on a specific area in your neck. When your doctor does this, he or she is pressing on your carotid sinus. The carotid sinus lies under your skin in 1 of the carotid arteries (",
"      <a class=\"graphic graphic_figure graphicRef83850 \" href=\"mobipreview.htm?18/43/19122\">",
"       figure 1",
"      </a>",
"      ). The carotid arteries are the main blood vessels that bring blood to the brain. The doctor will press on your carotid sinus for about 5 to 10 seconds.",
"     </p>",
"     <p>",
"      During carotid sinus massage, the doctor will monitor your blood pressure and heart activity. To monitor your heart activity, he or she will do an electrocardiogram (also called an &ldquo;ECG&rdquo; or &ldquo;EKG&rdquo;).",
"     </p>",
"     <p>",
"      Carotid sinus massage slows down the heartbeat and lowers a person&rsquo;s blood pressure. This maneuver can make people feel light-headed or like they might pass out.",
"     </p>",
"     <p>",
"      Doctors usually don&rsquo;t do carotid sinus massage in people who have certain medical conditions, including carotid artery disease. In carotid artery disease, fatty clumps called &ldquo;plaques&rdquo; build up in the carotid arteries.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2366600547\">",
"      <span class=\"h1\">",
"       What does the Valsalva maneuver involve?",
"      </span>",
"      &nbsp;&mdash;&nbsp;For the Valsalva maneuver, your doctor will have you breathe in and then try to breathe out hard, keeping your mouth and nose closed. This can feel like you are &ldquo;bearing down&rdquo; and trying to have a bowel movement.",
"     </p>",
"     <p>",
"      The doctor will have you hold this position for up to 10 seconds. Then you can breathe normally again.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2366600562\">",
"      <span class=\"h1\">",
"       Why might my doctor use a vagal maneuver on me?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors commonly use vagal maneuvers to diagnose or treat certain heart problems. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Different kinds of tachycardia &ndash; Tachycardia is the medical term for when the heartbeat is faster than normal. Carotid sinus massage or the Valsalva maneuver can sometimes slow down or stop tachycardia, so the heart can beat normally again.",
"       </li>",
"       <li>",
"        Heart murmurs &ndash; The Valsalva maneuver is used in people who have a heart murmur. A heart murmur is an extra sound that doctors or nurses hear when they listen to the heart with a stethoscope. Your doctor or nurse might have you do the Valsalva maneuver when he or she listens to your heart. This will tell the doctor or nurse more about your heart murmur.",
"       </li>",
"       <li>",
"        A condition called &ldquo;heart block&rdquo; &ndash; In heart block, the electrical signals in the heart are slowed or stopped. Carotid sinus massage can help show your doctor where the block in your heart is.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Doctors also sometimes use these maneuvers to try to find out why a person has fainted. Carotid sinus massage can show if the fainting is from a condition called &ldquo;carotid sinus hypersensitivity.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2366600577\">",
"      <span class=\"h1\">",
"       Are there other vagal maneuvers that doctors use?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors sometimes use other vagal maneuvers, but these are rarely done. They involve putting a person&rsquo;s face in a bowl of ice water, or pressing on a person&rsquo;s eyeball. Both of these maneuvers slow down the heartbeat.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2366600592\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?12/14/12512?source=see_link\">",
